description:
JSA Classified featured previously untold adventures of the Justice Society of America at various points in their history, as well as spotlighting specific members in solo stories.  

The first story-arc investigates the many contradictory origin theories surrounding Power Girl, written by Geoff Johns (Green Lantern) with art by Amanda Conner (Vampirella).


